import {AiOutlineLinkedin} from "react-icons/ai"
import {AiOutlineInstagram} from "react-icons/ai"
import {FiGithub} from "react-icons/fi"

const Footer = () => {
    return (
        <div id="footer">
            <a href="https://github.com/JRN03" target="_blank"><FiGithub/></a>
            <a href="https://www.instagram.com/_j.nguyen08/" target="_blank"><AiOutlineInstagram/></a>
            <a href="https://www.linkedin.com/in/jonathan-nguyen-a6781220b/" target="_blank"><AiOutlineLinkedin/></a>
        </div>
    )
}

export default Footer
